import Footer from "./Components/Footer";
import Header from "./Components/Header";

function App() {
  return (
    <>
    <Header/>
      <main>
        <div>
          Welcome to Proshop
      </div>
    </main>
    <Footer/>
    </>
  );
}

export default App;
